import React from 'react';

const NewCardPopUp = ({togglePopUp}) => {

  const handleToggle = _ => {
    togglePopUp();
  }
  return (
    <div className="new-card-component">
        <label for="card-front">Front of Card</label>
        <input type="text" id="card-front" />
        <button className="close-popup" onClick={handleToggle}>close</button>
    </div>
  )
}

export default NewCardPopUp;
